export default function PlayerCard(props) {
    const {details} = props;
    return <>
            <div className="cards">
           <h1>{details.name}</h1>
           <img src="https://a.espncdn.com/combiner/i?img=/i/headshots/nba/players/full/3934719.png"></img>
           <p>{details.position}</p>
           <p>{details.minutes}</p>

           </div>
           </>;
}
